import "./App.css";
import Cryptocurrency from "./Cryptocurrency/Cryptocurrency";
import logoTag from "./images/coin-tsunami-logo-crop.png";
// const axios = require("axios").default;

function App() {
  // cryptocurrency api
  const DOG_URL = "https://dog.ceo/api/breeds/image/random";

  const promise = fetch(DOG_URL);
  let picture = null;
  promise
    .then(function (response) {
      const processingPromise = response.json();
      return processingPromise;
    })
    .then(function (processedResponse) {
      picture = processedResponse.message;
      console.log(processedResponse);
    });
  // // const axios = require("axios");
  // // const URL = "";

  // axios
  //   .get("/user?ID=12345")
  //   .then(function (response) {
  //     // handle success
  //     console.log(response);
  //   })
  //   .catch(function (error) {
  //     // handle error
  //     console.log(error);
  //   })
  //   .then(function () {
  //     // always executed
  //   });

  return (
    <div className='App'>
      <img className='logo' src={logoTag} alt='coin tsunami logo' />
      {/* cryptocurrencies */}
      <img src={picture} alt='dog' />
      {/* <div className='cryptocurrency-rankings-container'>
        <Cryptocurrency />
      </div> */}
    </div>
  );
}

export default App;
